import React, { Component } from 'react'

class Post extends Component {
    constructor(props) {
        super(props)
    
        this.state = {
             posts: []
        }
    }
    
    componentWillMount () {
        fetch('https://jsonplaceholder.typicode.com/posts')
        .then(res => res.json())
        .then(data =>this.setState({ post: data }))
}

    render() {
        const { posts } = this.state;
        return (
            <div>
                <h1>Posts</h1>
                { posts.map(posts=>(
                    <p key>{ posts }</p>
                )) }
            </div>
        )
    }
}

export default Post;
